Licenc Azonosító, egy globálisan egyedi azonosító egy licenchez vagy szerződéshez, amely alapján az elemeket előállítják, feldolgozásra benyújtják és/vagy kifizetik, amelyet az alábbiak összefűzésével hoznak létre:
 - egy ISO/IEC 15459 kiadói ügynökségi kód;
 - egy licenc- vagy szerződésszám, amely megfelel az érintett kiadói ügynökség specifikációinak;
 és amely:
 - kizárólag nagybetűs betűkből és/vagy számjegyekből áll;
 - egyedi (azaz különbözik minden más ISO/IEC 15459 szabványos azonosítótól) az ügynökség domainjén belül;
 - nem származtatható semmilyen más ISO/IEC 15459 szabványos azonosítóból, amelyet ugyanazon ügynökség adott ki, egyszerűen karakterek hozzáadásával vagy eltávolításával a végéről.

FAO halászati terület kódja, amelyet az FAO Halászati és Akvakultúra Osztálya határoz meg (http://www.fao.org. Keresse meg a Halászati Terület Kód aloldalt).
Az ISO/IEC 646 GS1 Általános Specifikációja által meghatározott karakterkészlet minden karaktere engedélyezett.
Példák:
18L37.1.3 Nyugat-mediterrán tenger, Szardínia;
18L47.B.1 Atlanti-óceán, Délkelet, SEAFO Divízió, Namíbia EEZ;
18L67 Csendes-óceán, Északkelet.

'26L' Helykód, egy olyan hely vagy földrajzi terület azonosító kódja, vagy az ilyen helyekhez vagy területekhez kapcsolódó csoport, amely releváns egy kapcsolódó tranzakcióhoz, és amely megfelel az (a)-tól (f)-ig meghatározott struktúráknak:
a) két nagybetűs karakter, amely megfelel az országban található, vagy abból álló hely(ek)nek vagy terület(ek)nek ISO 3166-1 kétbetűs országkódjának;
b) három nagybetűs karakter, amely megfelel azon repülőtér vagy város IATA kódjának, ahol, vagy amelyhez közel, vagy amelyből áll a hely(ek) vagy terület(ek);
c) négy vagy több karakter, amelyek közül az első három megfelel egy ISO 3166-1 országkódnak, amit egy kötőjel (-) követ, a maradék pedig az érintett országban található irányítószám;
d) négy vagy több karakter, amelyek közül az első három megfelel egy ISO 3166-1 országkódnak, amit egy pont (.) követ, a maradék pedig az érintett országban található ISO 3166-2 országrész kódja;
e) öt nagybetűs karakter, amely megfelel az UN/LOCODE-nak azon a területen, közelében vagy amelyből áll a hely(ek) vagy terület(ek);
f) a konkatenáció, amely legalább hét, de legfeljebb 35 karakter hosszúságú, az alábbiakból áll:
- egy ISO/IEC 15459 kiadói ügynökségi kód;
- egy helykód, amely a {A-Z; 0-9} karakterkészletből álló karakterekből áll, amely megfelel az ügynökség specifikációinak.

