• Tanúsítvány (an5...20)

Vízi Tudományok és Halászat Információs Rendszere (ASFIS) 'Inter-ügynökségi 3-alfabetikus fajkód', amelyet az Egyesült Nemzetek Élelmezésügyi és Mezőgazdasági Szervezete (www.fao.org, majd keresse meg az 'ASFIS') tart fenn.
Példák:
7RMUC = Sáros ponty;
7RPCD = Ausztrál édesvízi hering;
7RWSH = Nagy fehér cápa.

Élelmezésügyi és Mezőgazdasági Szervezet (FAO) Nemzetközi Standard Halászati Eszközök Osztályozási Kódja (ISSCFG). (www.fao.org)
Az ISO/IEC 646 GS1 Általános Specifikációban meghatározott karakterkészletének összes karaktere engedélyezett.
Példák:
8R02.1.0 = Part menti hálók;
8R03.1.5 = Garnélarákok;
8R05.1.0 = Hordozható emelőháló.

