Berendezés Azonosító, egy globálisan egyedi azonosító egy eszköz, berendezés vagy egy számítógépes alkalmazás példány számára, amelyet az előállítás, szállítás, feldolgozás vagy más tételek kezelésében használnak, amelyet a következők konkatenálásával hoznak létre:
 - egy ISO/IEC 15459 kiadói ügynökségi kód;
 - egy berendezésszám, amely megfelel az érintett kiadói ügynökség specifikációinak; és hogy:
 - csak nagybetűs alfabetikus és/vagy numerikus karakterekből áll;
 - egyedi (azaz különbözik bármely más ISO/IEC 15459-nek megfelelő azonosítótól) a kiadói ügynökség doménjén belül;
 - nem lehet bármely más ISO/IEC 15459-nek megfelelő azonosító, amelyet ugyanazon kiadói ügynökség adott ki, egyszerűen karakterek hozzáadásával vagy eltávolításával.
Olvasó AZ.
Berendezés azonosító, egy globálisan egyedi azonosító egy eszköz, berendezés vagy egy számítógépes alkalmazás példány számára, amelyet az előállítás, szállítás, feldolgozás vagy más tételek kezelésében használnak.

UPU Helykód, egy hely vagy földrajzi terület, vagy az ehhez kapcsolódó helyek vagy területek csoportjának azonosítására szolgáló kód, amely releváns egy kapcsolódó tranzakcióhoz és amely megfelel az alábbi a)-tól g)-ig terjedő szerkezetek egyikének:
a) két nagybetűs alfabetikus karakter, amely megfelel az ország ISO 3166-1 kétbetűs országkódjának, amelyben, vagy amelyből áll, a hely(ek) vagy terület(ek);
b) három nagybetűs alfabetikus karakter, amely megfelel a repülőtér vagy város IATA kódjának, amelyben, közelében, vagy amelyből áll, a hely(ek) vagy terület(ek);
c) négy vagy több karakter, amelynek az első három megfelel egy ISO 3166-1 országkódnak, amelyet egy kötőjel (-) követ, a maradék pedig az adott országban érvényes irányítószám;
d) négy vagy több karakter, amelynek az első három megfelel egy ISO 3166-1 országkódnak, amelyet egy pont (.) követ, a maradék pedig az adott ország ISO 3166-2 országalkotórész kódja;
e) öt nagybetűs alfabetikus karakter, amely megfelel az UN/LOCODE kódnak azon a területen, közelében vagy amelyből áll, a hely(ek) vagy terület(ek);
f) hat nagybetűs alfanumerikus karakter, amely megfelel az UPU IMPC kódnak, amelyet az UPU S34 standard szerint osztanak ki;
g) a konkatenáció, amely nem kevesebb, mint hét, de nem több, mint 25 karakter hosszúságú, amely tartalmazza:
 - egy UPU standardok S31 szerint kiosztott kiadói kódot;
 - egy helykódot, amely a {A-Z; 0-9} karakterkészletből álló karakterekből áll, amely megfelel az adott kiadó specifikációjának.

Rendszámtábla Szolgáltatási Adatokkal és Helykóddal egy összetett adatszerkezet, amely megfelel az UPU S25 standardban meghatározott specifikációnak, amely tartalmazza:
 - egy ISO/IEC 15459 szerinti cikkazonosítót;
 - egy 5U adatazonosítóval megfelelő specifikációt a cikkre vonatkozóan nyújtandó szolgáltatásról;
 - egy 17U adatazonosítóval megfelelő UPU helykódot vagy egy 18U adatazonosítóval megfelelő minősített UPU helykódot.
 Megjegyzés - További részletekért lásd az UPU S25 standardot. Az egyszerű UPU helykód (DI 17U) és a minősített UPU helykód (DI 18U) közötti különbség az első karakterből megállapítható. Ha ez numerikus, akkor 18U érvényes; ha ez alfabetikus, akkor 17U érvényes.

