Dátum, módosított UTC-kompatibilis formában reprezentálva:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] ahol a szögletes zárójelek az opcionális részeket jelölik, yyyy az év, mmdd a hónap és nap, hhmmss az idő órában, percben és másodpercben, fff a másodpercek törtrészei, és poooo az UTC-től való eltérés órában és percben kifejezve, az eltérés pozitív, ha p pont (.), negatív, ha P mínuszjel (-).
PÉLDA:
2005 - (UTC) 2005-ös naptári év;
200505 - (UTC) 2005 május hónap;
20050518 - (UTC) 2005. május 18.;
200505181247 - 12:47 UTC 2005. május 18-án;
200505181247.0100 - 12:47 helyi idő, ami 11:47 UTC, 2005. május 18-án;
20050518124723099 - 99 ezredmásodperc múlva UTC 12:47:23 2005. május 18-án.

Minősített Dátum, a következők konkatenációja:
- egy ISO/IEC 15459 kiadói ügynökségi kód;
- egy dátumminősítő, amely megfelel az adott kiadói ügynökség specifikációinak;
- egy dátum, amelynek formátuma és értelmezése megfelel az adott kiadói ügynökség specifikációinak az adott dátumminősítőre vonatkozóan.

Csomagolóanyag Kategóriájának*, Kódjának* és Súlyának Kijelentése egy adott csomagolóanyag esetében, amelyet egy adott csomagolásban használnak az EU csomagolási és csomagolási hulladék irányelv szerint. (Az anyagkategória és kód az M mellékletben van meghatározva).
12ECCMMMMMMNNNNNUU ahol: - '12E' (an3) az Adat Azonosító;
 - 'CC' (n2) az Anyagkategória az M melléklet szerint;
 - 'MMMMMM' (an1...6) az Anyagkód az M melléklet szerint;
 - 'NNNNN' (n5) Anyagsúly, tizedes ponttal együtt (pl. 12.12);
 - 'UU' (an2) a súly mértékegysége (pl. KG, GR, LB vagy OZ az ANSI X12.3 szerint, mint az D mellékletben).

Fél Neve.
Egy fél neve, amelyet egy plusz (+) karakter követ, majd egy vagy több kódból álló sorozat az EDIFACT Kódlista 3035 'Fél Minősítő' szerint, pl.;
BY [Vevő];
CF [Konténer üzemeltető];
CN [Címzett];
