DEI [Hajó üzemeltetője/kapitány];
FA [Műveleti személyzet kód];
IM [Importőr];
MF [Gyártó];
OS [Feladó];
SE [Eladó];
ST [Szállítási cím];
UC [Végső címzett].

Címzett Száma.
Az egyedi azonosító szám az IRS, EIN, SSN, vagy a CBP által hozzárendelt szám lehet, amely a Biztonsági Bejelentésen szükséges. Csak a következő formátumok használhatók: IRS EIN: NN-NNNNNNN;
IRS EIN kiterjesztéssel:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP hozzárendelt szám: YYDDPP-NNNNN.
